import React, { Component } from "react";
import './css/style.css';
const download = require('./download');
import DownloadLink from "react-download-link";

class Image extends Component {




    render() { 
        let imgArray= this.props.obj;
        return ( 
        <React.Fragment>
     {
            imgArray.map((value,index)=>

                <div id="img" key={index}style={{position:'relative'}}>
                    <a href="https://s1.nyt.com/du/books/images/9780393254600.jpg" download>
                    <img style={{width:"300px", height:"500px"}} 
                        src={value} className='image' onClick={() => download.saveAs()}  alt="Images"/>
                    </a>
                    {/* <DownloadLink filename={"image.jpg"} exportFile={() => 'dummy'}><img style={{width:"300px", height:"500px"}} 
                        src={value} className='image'  alt="Images"/></DownloadLink> */}
                    <img src="/download.png" className="middle" />
                </div>
            )
        }
        </React.Fragment>)

    }
}
export default Image;
